import { Component } from "react";
export class Student extends Component{
    constructor(props){
        super(props);
        this.name = props.name;
        this.roll_no = props.roll_No;
    }
    render(){
        return (
            <div>
        {this.name}<br/><b>RollNo.</b>{this.roll_no}
            </div>
        );
    }
}
